import React from 'react'
import { List, Icon, Avatar } from 'antd';

function Message(props) {

    const AvatarSrc = props.who ==='bot' ? <Avatar src="https://andc-scale.livewallcampaigns.com/imageScaled/?site=andc&file=1591975072_oprah-header.jpg&w=1200&h=675&cropped=1"  size="large" shape="square"/> : <Avatar src="https://avatars2.githubusercontent.com/u/61470614?s=460&u=4f1f3b622b5593bb1faad2518cedad29ba903ed3&v=4" />  

    return (
        <List.Item style={{ padding: '1rem' }}>
            <List.Item.Meta
                avatar={<Avatar icon={AvatarSrc} size="large"/>}
                title={props.who}
                description={props.text}
            />
        </List.Item>
    )
}

export default Message
